using StellarSync.API.Data;
using StellarSync.API.Data.Comparer;
using StellarSync.StellarConfiguration;
using StellarSync.Services.Mediator;
using StellarSync.WebAPI;
using Microsoft.Extensions.Logging;
using System.Collections.Concurrent;

namespace StellarSync.Services;

public class StellarProfileManager : MediatorSubscriberBase
{
    private const string _stellarLogo = "";
    private const string _stellarLogoLoading = "";
    private const string _stellarLogoNsfw = "";
    private const string _stellarSupporter = "";
    private const string _noDescription = "-- User has no description set --";
    private const string _nsfw = "Profile not displayed - NSFW";
    private readonly ApiController _apiController;
    private readonly StellarConfigService _stellarConfigService;
    private readonly ConcurrentDictionary<UserData, StellarProfileData> _stellarProfiles = new(UserDataComparer.Instance);

    private readonly StellarProfileData _defaultProfileData = new(IsFlagged: false, IsNSFW: false, _stellarLogo, string.Empty, _noDescription);
    private readonly StellarProfileData _loadingProfileData = new(IsFlagged: false, IsNSFW: false, _stellarLogoLoading, string.Empty, "Loading Data from server...");
    private readonly StellarProfileData _nsfwProfileData = new(IsFlagged: false, IsNSFW: false, _stellarLogoNsfw, string.Empty, _nsfw);

    public StellarProfileManager(ILogger<StellarProfileManager> logger, StellarConfigService stellarConfigService,
        StellarMediator mediator, ApiController apiController) : base(logger, mediator)
    {
        _stellarConfigService = stellarConfigService;
        _apiController = apiController;

        Mediator.Subscribe<ClearProfileDataMessage>(this, (msg) =>
        {
            if (msg.UserData != null)
                _stellarProfiles.Remove(msg.UserData, out _);
            else
                _stellarProfiles.Clear();
        });
        Mediator.Subscribe<DisconnectedMessage>(this, (_) => _stellarProfiles.Clear());
    }

    public StellarProfileData GetStellarProfile(UserData data)
    {
        if (!_stellarProfiles.TryGetValue(data, out var profile))
        {
            _ = Task.Run(() => GetStellarProfileFromService(data));
            return (_loadingProfileData);
        }

        return (profile);
    }

    private async Task GetStellarProfileFromService(UserData data)
    {
        try
        {
            _stellarProfiles[data] = _loadingProfileData;
            var profile = await _apiController.UserGetProfile(new API.Dto.User.UserDto(data)).ConfigureAwait(false);
            StellarProfileData profileData = new(profile.Disabled, profile.IsNSFW ?? false,
                string.IsNullOrEmpty(profile.ProfilePictureBase64) ? _stellarLogo : profile.ProfilePictureBase64,
                !string.IsNullOrEmpty(data.Alias) && !string.Equals(data.Alias, data.UID, StringComparison.Ordinal) ? _stellarSupporter : string.Empty,
                string.IsNullOrEmpty(profile.Description) ? _noDescription : profile.Description);
            if (profileData.IsNSFW && !_stellarConfigService.Current.ProfilesAllowNsfw && !string.Equals(_apiController.UID, data.UID, StringComparison.Ordinal))
            {
                _stellarProfiles[data] = _nsfwProfileData;
            }
            else
            {
                _stellarProfiles[data] = profileData;
            }
        }
        catch (Exception ex)
        {
            // if fails save DefaultProfileData to dict
            Logger.LogWarning(ex, "Failed to get Profile from service for user {user}", data);
            _stellarProfiles[data] = _defaultProfileData;
        }
    }
}